      <div className={'row'}>
        <div key = {this.props.post.nb}  className={'col-md-4'} >

            {this.props.posts.map((post) => <Post key={post.id} post={post} />)}

        </div>
      </div>
      // </form>
    )}



}



const mapStateToProps = (state) => {
    return  {
        posts: state
    }
}
export default connect(mapStateToProps)(AllPost)
